import './App.css';
import './profile.css';
import sample from "./sample.jpeg";

function profile() {
    return (
        <div className="profile">
            <div className="profile_picture">
                <img src={sample}/>
            </div>
            <div className="profile_info">
                <p>user_firstName</p>
                <p>user_lastName</p>
                <p>user_email</p>
            </div>
        </div>

    );
}

export default profile;
